import {Link} from 'react-router-dom';

function Header() {
    return (
        <div>
            <nav>
                <ul>
                    <li><Link exact="true" className="" to="/">Home</Link></li>
                    <li><Link className="" to="/note">Note</Link></li>
                    <li><Link className="" to="/create">Create</Link></li>
                    <li><Link exact className="" to="/about">About</Link></li>
                </ul>
            </nav>
        </div>
    );
}

export default Header;
